bool Level::collisionAt(int x, int y, int width, int height) {
  if (tileAt(x, y + height - 1)) return true;
  if (tileAt(x + width - 1, y + height - 1)) return true;
  if (tileAt(x + width - 1, y)) return true;
  if (tileAt(x, y)) return true;

  return false;
}

