byte Level::tileAt(int x, int y) {
  int gridX = x / TILE_SIZE;
  int gridY = y / TILE_SIZE;

  // Solid outside of map
  if (gridX < 0 || gridX >= LEVEL_COLS || gridY < 0 || gridY >= LEVEL_ROWS) return 1;

  return tiles[gridY][gridX] == 0 ? 0 : 1;
}

